import { View, Image, StyleSheet } from 'react-native';
import * as Animatable from 'react-native-animatable';

export const Animated = props => {
  return (
    <Animatable.View
      animation={props.animation}
      delay={props.delay}
      duration={props.duration}
      iterationCount={props.iterationCount}
      easing={props.easing}
      useNativeDriver={true}
      style={styles.absolute}
    >
      <Image
        // resizeMode="contain"
        style={[styles.absolute, props.styles]}
        source={props.source}
        styles={[styles.absolute, props.styles]}
      />
    </Animatable.View>
  );
};

const styles = StyleSheet.create({
  absolute: {
    position: 'absolute',
    top: 0,
    left: 0,
    height: Dimensions.CARD_IMAGE_SIZE_SMALL,
    width: Dimensions.CARD_IMAGE_SIZE_SMALL,
  },
});
